(17404, 0, 133, 12, 50, 457, 4, 0, '2015-03-03', 'Arriba tard a classe i per justificar-se diu que ha anat a trucar a casa seva i que ha donat l''encàrreg al Mussa. "No t''ho ha dit el Mussa", em diu. Li contesto que no. I respon, en veu alta: "me cago en su puta madre".', 5),
(17405, 0, 24, 18, 108, 456, 4, 0, '2015-03-03', 'En lloc de fer les activitats amb l''ordinador estava amb el mòbil i fent gresca amb un companya. Després que la professora advertís vàries vegades que havien de treballar. Quan li dic que li requiso el mòbil, em diu: "Torna''m el mòbil aquí". Després segueix protestant i responent malament, sense cap respecte a la professora i a la classe.', 4),
(17406, 0, 32, 18, 108, 456, 4, 0, '2015-03-03', 'L''amonesto per jugar, riure constantment i continuar rient i jugant. Després de ser avisat i renyat per la professora. \r\n', 4),
